import React, { useState } from 'react';
// Importa React y el hook useState desde la librería 'react'.

import './RegisterForm.css';
// Importa el archivo CSS para estilizar el componente.

import { FaUser, FaLock } from "react-icons/fa";
// Importa los iconos de usuario y candado desde 'react-icons/fa'.

import { ToastContainer, toast } from 'react-toastify';
// Importa el contenedor y la función 'toast' desde 'react-toastify' para mostrar notificaciones.

import 'react-toastify/dist/ReactToastify.css';
// Importa el archivo CSS necesario para el correcto funcionamiento de 'react-toastify'.

import { Link } from 'react-router-dom';
// Importa el componente 'Link' desde 'react-router-dom' para la navegación interna.

import axios from 'axios';
// Importa la librería 'axios' para realizar peticiones HTTP.

const RegisterForm = () => {
  // Define el componente funcional RegisterForm.

  const [userId, setUserId] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  // Declara los estados locales para 'userId', 'password' y 'confirmPassword' utilizando el hook 'useState'.

  const handleUserIdChange = (e) => {
    const value = e.target.value;
    if (!/^\d*$/.test(value)) {
      return;
    }
    if (value.length <= 9) {
      setUserId(value);
    }
  };
  // Función para manejar los cambios en el campo de 'userId'. Permite solo números y un máximo de 9 dígitos.

  const validateUserId = (id) => {
    const regex = /^\d{9}$/;
    if (!regex.test(id)) {
      return 'El ID de usuario debe contener exactamente 9 dígitos.';
    }
    return '';
  };
  // Función para validar el 'userId'. Debe contener exactamente 9 dígitos.

  const validatePassword = (pass) => {
    const regex = /^(?=.*[A-Z])(?=.*\d)(?=.*[@$!%*?&])[A-Za-z\d@$!%*?&]{8,}$/;
    if (!regex.test(pass)) {
      return 'La contraseña debe tener al menos 8 caracteres, una mayúscula, un número y un carácter especial.';
    }
    return '';
  };
  // Función para validar la 'password'. Debe tener al menos 8 caracteres, una letra mayúscula, un número y un carácter especial.

  const validateConfirmPassword = (confirmPass) => {
    if (confirmPass !== password) {
      return 'Las contraseñas no coinciden.';
    }
    return '';
  };
  // Función para validar que la 'confirmPassword' coincida con la 'password'.

  const handleSubmit = async (event) => {
    event.preventDefault();
    const userIdError = validateUserId(userId);
    const passwordError = validatePassword(password);
    const confirmPasswordError = validateConfirmPassword(confirmPassword);

    if (userIdError) {
      toast.error(userIdError);
      return;
    }

    if (passwordError) {
      toast.error(passwordError);
      return;
    }

    if (confirmPasswordError) {
      toast.error(confirmPasswordError);
      return;
    }

    try {
      const response = await axios.post('http://localhost:3001/register', {
        userId: userId,
        password: password
      });

      if (response.status === 200) {
        toast.success('Registro exitoso.');
        setUserId('');
        setPassword('');
        setConfirmPassword('');
      }
    } catch (error) {
      toast.error('Error al registrar el usuario.');
    }
  };
  // Función para manejar el envío del formulario. Valida los campos, muestra errores con 'toast' y envía los datos mediante una petición POST a un servidor.

  return (
    <div className='wrapper'>
      <form onSubmit={handleSubmit}>
        <h1>Registro</h1>
        <div className="input-box">
          <input
            type="text"
            placeholder="ID de Usuario"
            value={userId}
            onChange={handleUserIdChange}
            required
            maxLength={9}
            className={userId.length === 9 ? 'valid' : ''}
          />
          <FaUser className='icon' />
        </div>
        <div className="input-box">
          <input
            type="password"
            placeholder="Contraseña"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
          <FaLock className='icon' />
        </div>
        <div className="input-box">
          <input
            type="password"
            placeholder="Confirmar Contraseña"
            value={confirmPassword}
            onChange={(e) => setConfirmPassword(e.target.value)}
            required
          />
          <FaLock className='icon' />
        </div>
        <button type="submit">Registrarse</button>
        <div className="register-link">
          <p>¿Ya tienes una cuenta? -{'>'} <Link to="/">Iniciar Sesión</Link></p>
        </div>
      </form>
      <ToastContainer position="top-center" />
    </div>
  );
  // Renderiza el formulario de registro. Incluye campos de entrada para 'userId', 'password' y 'confirmPassword', además de un botón de envío. Utiliza 'ToastContainer' para mostrar notificaciones de 'toast'.

};

export default RegisterForm;
// Exporta el componente RegisterForm como el export por defecto del módulo.
